import { Component, OnInit } from '@angular/core';
import { HotelFilter } from '../hotel-filter';
import { HotelService } from '../hotel.service';
import { Hotel } from '../hotel';

@Component({
  selector: 'app-hotel',
  templateUrl: 'hotel-list.component.html'
})
export class HotelListComponent implements OnInit {

  filter = new HotelFilter();
  selectedHotel!: Hotel;
  feedback: any = {};

  get hotelList(): Hotel[] {
    return this.hotelService.hotelList;
  }

  constructor(private hotelService: HotelService) {
  }

  ngOnInit() {
    this.search();
  }

  search(): void {
    this.hotelService.load(this.filter);
  }

  select(selected: Hotel): void {
    this.selectedHotel = selected;
  }

  delete(hotel: Hotel): void {
    if (confirm('Are you sure?')) {
      this.hotelService.delete(hotel).subscribe({
        next: () => {
          this.feedback = {type: 'success', message: 'Delete was successful!'};
          setTimeout(() => {
            this.search();
          }, 1000);
        },
        error: err => {
          this.feedback = {type: 'warning', message: 'Error deleting.'};
        }
      });
    }
  }
}
<ol class="breadcrumb float-right">
  <li class="breadcrumb-item"><a routerLink="/">Home</a></li>
  <li class="breadcrumb-item active">Hotel</li>
</ol>
<div class="card">
  <div class="header">
    <h2 class="title">Hotel List</h2>
  </div>
  <div class="content">
    <form #f="ngForm">

      <div class="form-group">
        <label for="city">City:</label>
        <input [(ngModel)]="filter.city" id="city" name="city" class="form-control">
      </div>

      <button (click)="search()" [disabled]="!f?.valid" class="btn btn-primary">Search</button>
      <a [routerLink]="['../hotels', 'new' ]" class="btn btn-default">New</a>
    </form>
  </div>
</div>
<div class="card" *ngIf="hotelList.length > 0">
  <div *ngIf="feedback.message" class="alert alert-{{feedback.type}}">{{ feedback.message }}</div>
  <div class="table-responsive">
    <table class="table table-centered table-hover mb-0" id="datatable">
      <thead>
        <tr>
          <th class="border-top-0" scope="col">Id</th>
          <th class="border-top-0" scope="col">Name</th>
          <th class="border-top-0" scope="col">City</th>
          <th class="border-top-0" scope="col">Stars</th>
          <th class="border-top-0" scope="col" style="width:120px"></th>
        </tr>
      </thead>
      <tbody>
        <tr *ngFor="let item of hotelList" [class.active]="item === selectedHotel">

          <td>{{item.id}}</td>
          <td>{{item.name}}</td>
          <td>{{item.city}}</td>
          <td>{{item.stars}}</td>
          <td style="white-space: nowrap">
            <a [routerLink]="['../hotels', item.id ]" class="btn btn-secondary">Edit</a>&nbsp;
            <button (click)="delete(item)" class="btn btn-danger">Delete</button>
          </td>
        </tr>
      </tbody>
    </table>
  </div>
</div>
